import React from 'react'
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';
import PNG from '../../Assets/portfolio-3.png';
import './Work.css';

const Work = () => {

  const cardStyle = {
    maxWidth: 345,
    backgroundColor: 'rgb(40, 40, 46)', // Menentukan warna latar belakang
    color: 'white',
    
  };

  const textColor = {
    color: 'rgb(255, 255, 102)',
  }

  return (
    <section id='works'>
      <a ></a>
      <Card sx={cardStyle}>
        <CardActionArea>
          <CardMedia
            component="img"
            height="290"
            image={PNG}
            alt="She"
          />
          <CardContent>
            <Typography gutterBottom variant="h5" component="div">
              Kasir
            </Typography>
            <Typography variant="body2" sx={textColor}>
              Project kasir menggunakan framework laravel.
              Mencakup CRUD.
            </Typography>
          </CardContent>
        </CardActionArea>
      </Card>
    </section>
  )
}

export default Work
